float tau = 2.0 * 3.141592653589793238;

vec2 rotate( vec2 v, float a ) {
    float s = sin(a);
    float c = cos(a);
    mat2 m = mat2(c, -s, s, c);
    return m * v;
}

vec3 squidPalette( float t ) {
    vec3 a = vec3(0.8,0.5,0.4);
    vec3 b = vec3(0.2,0.4,0.2);
    vec3 c = vec3(2.0,1.0,1.0);
    vec3 d = vec3(0.0,0.25,0.25);
    return a + b*cos( 6.28318*(c*t+d) );
}

vec3 waterPalette ( float t ) {
    vec3 a = vec3(-0.002, 0.668, 0.848);
    vec3 b = vec3(0.248, 0.158, -0.083);
    vec3 c = vec3(-0.722, 2.018, 1.346);
    vec3 d = vec3(1.678, 1.148, -0.273);
    return a + b*cos( 6.28318*(c*t+d) );
}


float computeSine(float normalizedX)
{
    float x = normalizedX * tau;
 	return sin(x);   
}

vec2 computeSine(vec2 normalizedVec) {
    return sin(normalizedVec * tau);
}

float computeSine_prime_x(float normalizedX)
{
    float x = normalizedX * tau;
    return cos(x);
}

vec2 computeSine_prime_x(vec2 normalizedVec)
{
    return cos(normalizedVec * tau);
}

#define iterOff (mod(i, 12.)+1.)

void mainImage( out vec4 fragColor, in vec2 fragCoord )
{
    // Normalized pixel coordinates (from 0 to 1)
    vec2 normalizedFragCoord = fragCoord/iResolution.xy;
    vec3 col = vec3(0); //all black

    float freq = 2.5;
    float amp = 0.3;


    for (float i = 0.; i < 30.; i++) {

        //float phase = 0.075*iterOff;
        float phase = 0.;
        //float timeOffset = iTime/6. * iterOff;
        float timeOffset = iTime/6.;
        //float yOffs = i/20. - cos(abs(timeOffset + 0.005 * (iterOff)));
        float yOffs = i/10. - 1.5;

        float y = amp * computeSine(normalizedFragCoord.x * freq + timeOffset - phase) + yOffs;
        y += 1.0;
        y /= 2.0;

        float dfx = amp * computeSine_prime_x(normalizedFragCoord.x * freq + timeOffset - phase) + yOffs;
        //dfx += 1.0;
        //dfx /= 2.0;

        float threshold = ((mod(i, 3.)+1.+abs(cos(iTime)))*10.0) / iResolution.y; 

        //float distanceEstimate = abs( y - normalizedFragCoord.y )/sqrt(1.0 + dfx*dfx);
        float distanceEstimate = abs( y - normalizedFragCoord.y )/sqrt(1.0 + dfx*dfx);
        vec3 waterColor = waterPalette(iTime*0.075+iterOff * 0.25);
        col = mix(waterColor, col, smoothstep(0.0, threshold, distanceEstimate) );

    }
    // Output to screen
    fragColor = vec4(col,1.0);
}
